import './Benefits.css';
import spaInterior from '../../../assets/spa-interior.png';
import anna from '../../../assets/anna-headshot.png';

const Benefits = () => {
  return (
    <div className="py-20 relative" style={{ backgroundColor: '#F3EFEB' }}>
      <div className="mx-auto grid place-items-center" style={{ maxWidth: '1550px' }}>
        <div
          className="w-full lg:flex flex-reverse bg-white"
          style={{ backgroundColor: '#F3EFEB' }}>
          <div className="p-6 lg:p-0 lg:w-full grid place-items-center bg-red-100">
            <p className="text-xl sm:text-2xl md:text-3xl font-semibold uppercase pb-8">
              book your
              <br />
              appointment
            </p>
            <p className="text-sm md:text-base lg:text-lg pb-8">
              With our warm and welcoming atmosphere, top-tier treatments, and commitment to
              exceeding your expectations, you&apos;re sure to walk away feeling thoroughly
              satisfied.
            </p>
          </div>
          <div className="lg:block hidden" style={{ width: '600px' }}>
            <img
              src={spaInterior}
              alt=""
              className="lg:absolute lg:top-[-350px] lg:right-[100px]"
            />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Benefits;
